import  './logo.module.css';
import logo from '../../Images/Logo.png';

function Logo() {
  return (
    <div className='logo'>
      <img 
        src={logo} 
        alt="logo"
        className='logo-img'
      ></img>

      <p><strong>B</strong>ooks</p>
    </div>
  );
}

export default Logo;
